void SpriteCodex::DrawTileNumber(const Vei2 & pos, int n, Graphics & gfx)
{
	switch (n)
	{
	case 0:
		DrawTile0(pos, gfx);
		break;
	case 1:
		DrawTile1(pos, gfx);
		break;
	case 2:
		DrawTile2(pos, gfx);
		break;
	case 3:
		DrawTile3(pos, gfx);
		break;
	case 4:
		DrawTile4(pos, gfx);
		break;
	case 5:
		DrawTile5(pos, gfx);
		break;
	case 6:
		DrawTile6(pos, gfx);
		break;
	case 7:
		DrawTile7(pos, gfx);
		break;
	case 8:
		DrawTile8(pos, gfx);
		break;
	}
}

