void SpriteCodex::DrawTilePepper( const Vei2& pos, int type, Graphics& gfx )
{
	switch (type)
	{
	case 1:
		DrawTilePepperRed(pos, gfx);
		break;
	case 2:
		DrawTilePepperGreen(pos, gfx);
		break;
	case 3:
		DrawTilePepperYellow(pos, gfx);
		break;
	}
}

